#!/usr/bin/env python

import os
from pathlib import Path
import shutil
import subprocess
from ewokscore import Task
import time
import contextlib
import io

def pickle_to_rick(path):
    with open(path, "rb") as f:
        pipeline = pickle.load(f)
    return pipeline

def rick_to_pickle(pipeline, dump_dir, filename):
    output_path = os.path.join(dump_dir, filename)
    with open(output_path, "wb") as f:
        pickle.dump(pipeline, f)
    return output_path

def run_command(command):
    # This will act as an in-memory text file to capture print statements
    output_capture = io.StringIO()

    with contextlib.redirect_stdout(output_capture):
        start_time = time.perf_counter()
        process_result = None
        try:
            print(f"Executing command: {' '.join(command)}")
            process_result = subprocess.run(command, capture_output=True, text=True, check=True)

            print("\n--- Command Output (stdout) ---")
            print(process_result.stdout)

            if process_result.stderr:
                print("\n--- Command Error (stderr) ---")
                print(process_result.stderr)

            print(f"\n--- Command finished successfully with exit code {process_result.returncode} ---")

        except subprocess.CalledProcessError as e:
            print(f"\n--- Command failed with exit code {e.returncode} ---")
            print(f"Error (stdout):\n{e.stdout}")
            print(f"Error (stderr):\n{e.stderr}")
        except FileNotFoundError:
            print("\n--- ERROR: 'apptainer' command not found ---")
            print("Please ensure Apptainer is installed and its executable is in your system's PATH.")
        except Exception as e:
            print(f"\n--- An unexpected error occurred: {e} ---")

        finally:
            end_time = time.perf_counter()
            duration = end_time - start_time
            print(f"\n--- Total Execution Time: {duration:.4f} seconds ---")
    
    # Get the complete log as a string from the in-memory buffer
    full_log = output_capture.getvalue()
    
    # Return both the log and the original process result object
    return {"full_log": full_log, "process_result": process_result}

class RunNanoReSculpted(Task, input_names=["scratch_directory", "nsparam_filepath", "num_procs", "obj_filepath"], output_names=["pos_filepath", "result"]):
    def run(self):
        scratch_directory = self.inputs.scratch_directory
        nsparam_filepath = self.inputs.nsparam_filepath
        obj_filepath = self.inputs.obj_filepath
        num_procs = self.inputs.num_procs
        os.makedirs(scratch_directory, exist_ok=True)
        os.chdir(scratch_directory)
        shutil.copy(obj_filepath, scratch_directory)
        command = [
            "apptainer",
            "run",
            "--containall",
            "--env",
            f"OMP_NUM_THREADS={num_procs}",
            "--bind",
            f".:{os.environ.get('HOME', '')}",
            "/data/id01/inhouse/polack/shared/nanosculpt/nanosculpt.sif",
            "nanoSCULPT",
            str(Path(nsparam_filepath).name)
        ]
        result = run_command(command)

        self.outputs.pos_filepath = str(Path(scratch_directory) / "exp.pos")
        self.outputs.result = result

class RunLammps(Task, input_names=["scratch_directory", "pos_filepath", "num_procs"], output_names=["minimized_filepaths", "result"]):
    def run(self):
        scratch_directory = self.inputs.scratch_directory
        pos_filepath = self.inputs.pos_filepath
        num_procs = self.inputs.num_procs
        os.makedirs(scratch_directory, exist_ok=True)
        os.chdir(scratch_directory)

        exp_in = """\
        # ---------- Initialize Simulation ---------------------
        clear
        units metal
        dimension 3
        boundary s s s
        atom_style atomic

        variable A equal 3.912

        # ---------- initiate the variables ---------------------

        lattice fcc ${A}

        # ---------- Create Atomistic Structure ---------------------
        read_data       exp.pos

        # ---------- Define Interatomic Potential ---------------------

        pair_style eam/alloy
        pair_coeff * * Pt_u3.eam Pt
        neighbor 2.0 bin
        neigh_modify delay 10 check yes

        # ---------- Define Settings ---------------------
        compute         centrosym all centro/atom fcc
        compute         pote_eng all pe/atom
        compute         pote_all all reduce sum c_pote_eng
        compute         peratom all stress/atom NULL

        # ---------- Run Minimization ---------------------
        reset_timestep 0
        thermo 10
        thermo_style    custom step pe lx ly lz press pxx pyy pzz pxy pxz pyz c_pote_all

        write_data      exp_write.lmp
        write_dump      all xyz  exp.xyz

        min_style       cg
        minimize        1e-15 1e-15 30000 30000
        # Sets energy tol to 0 (ignored), force tol to 1e-10
        # minimize 0.0 1.0e-10 30000 30000

        write_data       exp_minimized.lmp
        write_dump       all xyz  exp_minimized.xyz

        #compute         globalRDF all rdf 200 cutoff 3.5
        #fix             outRDF all ave/time 1 1 1 c_globalRDF[*] file rdf_output.dat mode vector
        #run             0
        """
        with open("exp.in", "w") as f:
            f.write(exp_in)
        with open("Pt_u3.eam", "w") as f:
            f.write(Pt_u3)

        command = [
            "apptainer",
            "exec",
            "--containall",
            "--bind",
            f".:{os.environ.get('HOME', '')}",
            "/data/id01/inhouse/polack/shared/lammps.sif",
            "mpirun",
            "-n",
            num_procs,
            "lmp_mpi",
            "-in",
            "exp.in"
        ]
        result = run_command(command)

        self.outputs.minimized_filepaths = [str(Path(scratch_directory) / file) for file in ["exp_write.xyz", "exp_minimized.xyz"]]
        self.outputs.result = result
        print(self.outputs.minimized_filepaths)
